DROP TABLE IF EXISTS orderItems;
DROP TABLE IF EXISTS orders;
DROP TABLE IF EXISTS products;
DROP TABLE IF EXISTS categories;
DROP TABLE IF EXISTS discount;
DROP TABLE IF EXISTS suppliers;
DROP TABLE IF EXISTS customers;
DROP TABLE IF EXISTS shippers;
DROP TABLE IF EXISTS employeeTerritories;
DROP TABLE IF EXISTS employees;
DROP TABLE IF EXISTS territories;
DROP TABLE IF EXISTS empRegion;
DROP TABLE IF EXISTS city;
DROP TABLE IF EXISTS country;
DROP TABLE IF EXISTS region;

CREATE TABLE categories (
    categoryid smallint NOT NULL,
    categoryname character varying(15) NOT NULL,
    description text,
    picture bytea
);

CREATE TABLE shippers (
    shipperid smallint NOT NULL,
    companyname character varying(40) NOT NULL,
    phone character varying(24)
);

CREATE TABLE region (
    regionid   smallint,
    regionname character varying(15) 
);

CREATE TABLE country (
    countryid  smallint,
    countryname character varying(20)
);

CREATE TABLE city (
    cityid smallint NOT NULL,
    postalcode character varying(10),
    cityname character varying(20),
    regionid smallint, 
    countryid smallint
);

CREATE TABLE suppliers (
    supplierID      smallint NOT NULL,
    companyname     varchar(40) NOT NULL,
    contactname     varchar(30),
    contacttitle   varchar(30),
    address  varchar(60),
    cityid smallint,
    phone varchar(24),
    fax varchar(24),
    homepage text
);

CREATE TABLE discount (
    discountID    INTEGER,
    discountDesc  VARCHAR(25)
);

CREATE TABLE products (
    productid smallint NOT NULL,
    productname varchar(40) NOT NULL,
    supplierid smallint,
    categoryid smallint,
    countryOriginID smallint,
    quantityperunit varchar(20),
    unitprice real,
    unitsinstock smallint,
    unitsonorder smallint,
    reorderlevel smallint,
    discontinued integer NOT NULL
);

CREATE TABLE customers (
    customerID varchar(10) NOT NULL,
    companyName varchar(40) NOT NULL,
    contactName varchar(30),
    contactTitle varchar(30),
    address varchar(60),
    phone varchar(24),
    fax varchar(24),
    cityID smallint
);

CREATE TABLE employees (
    employeeid smallint NOT NULL,
    lastname varchar(20) NOT NULL,
    firstname varchar(10) NOT NULL,
    title varchar(30),
    titleofcourtesy varchar(25),
    birthdate date,
    hiredate date,
    notes text,
    homephone varchar(24),
    extension varchar(4),
    address varchar(60),
    cityid smallint,
    reportsto smallint,
    photo bytea,
    photopath varchar(255)
);

CREATE TABLE empRegion (
    regionID smallint NOT NULL,
    regionDescription VARCHAR(10) NOT NULL
);

CREATE TABLE territories (
    territoryID character varying(20) NOT NULL,
    territoryName VARCHAR(25) NOT NULL,
    regionID smallint NOT NULL
);

CREATE TABLE employeeTerritories (
    employeeID smallint NOT NULL,
    territoryID varchar(20) NOT NULL
);

CREATE TABLE orders (
    orderid smallint NOT NULL,
    customerid bpchar,
    employeeid smallint,
    orderdate date,
    requireddate date,
    shippeddate date,
    shipvia smallint,
    freight real,
    shipname varchar(40),
    shipaddress varchar(60),
    shipcityid smallint
);

CREATE TABLE orderItems (
      orderID           smallint
    , productID         smallint
    , unitPrice         real
    , quantity          smallint
    , discount          real
    , discountDescID    smallint
);








